import { Navigate } from "react-router";
import "./UserPage.scss";
import { useNavigate } from "react-router";

const UserPage = () => {
  const navigate = useNavigate();

  return (
    <button
      className="logout-button"
      onClick={() => {
        localStorage.removeItem("Token");
        navigate("/login");
      }}
    >
      Logout
    </button>
  );
};

export default UserPage;
